(1, 'Remueva cápsula AMA', 'Remueva la cápsula LT-10-R del Actuador Manual/Automático de la cabina, colóquele su tapa de seguridad y ubíquela en un lugar seguro.', 1, NULL, NULL, 1, '2021-07-15 17:34:52', '2021-07-15 17:34:52', 1, NULL),
(2, 'RESET del SC-N', 'Presione por cinco (5) segundos el botón RESET del módulo CHECKFIRE SC-N . Verifique que el módulo esté en modo normal de operación (LED verde POWER encendido o pulsando una vez cada tres (3) segundos)', 1, NULL, NULL, 1, '2021-07-15 17:34:52', '2021-07-15 17:34:52', 1, NULL),
(3, 'Verifique Módulo SC-N', 'tiene hijo', 1, 1, NULL, 1, '2021-07-15 17:34:52', '2021-07-15 17:34:52', 1, NULL),
(4, 'Verifique la batería', 'Verifique la fecha de instalación de la batería. Reemplace si es mayor a un (1) año o no está marcada.', 1, NULL, 1, 1, '2021-07-15 17:34:52', '2021-07-15 17:34:52', 1, NULL),
(5, 'Prueba DELAY al CF SC-N', 'Genere una falla al Módulo CHECKFIRE SC-N y presione por cinco (5) segundos el botón DELAY. Verique que no se enciende ningún led de falla adcional a la falla generada en el Módulo. En caso de encenderse un led de falla adicional, se debe corregir la falla y luego volver a repetir. ', 1, NULL, NULL, 1, '2021-07-15 17:34:52', '2021-07-15 17:34:52', 1, NULL),
(6, 'Verifique Fin de Línea', 'Verifique que el Fin de Línea se encuentre en buen estado, que no presente deformación o deterioro físico. Con un multímetro verifique la resistencia de la misma (4,7 K ohmios).', 1, NULL, NULL, 1, '2021-07-15 17:34:52', '2021-07-15 17:34:52', 1, NULL),
