(125, 'Verifique el PAD', 'Retire la guarda protectora del PAD y desconéctelo. Desenrosque la parte superior del actuador retire cuidosamente el PAD. Verifique la fecha de fabricación del PAD, reemplace si es mayor a 5 años.', 1, NULL, 1, 1, '2021-07-15 17:34:52', '2021-07-15 17:34:52', 2, 43),
(126, 'Desarme el AMA', 'Remueva el Actuador Manual/Automático de su soporte. Retire el resorte y percutor del interior del cuerpo del Actuador.', 1, NULL, NULL, 1, '2021-07-15 17:34:52', '2021-07-15 17:34:52', 2, 43),
(127, 'Verifique o-rings', 'Retire los o-rings de la rosca superior del actuador, del vástago, y de la parte inferior del Actuador Manual/Automático. Verifique que se encuentran en buen estado, en caso contrario cámbielo por uno nuevo. Limpie y lubrique los o-rings con grasa siliconada. Instalelos nuevamente.', 1, NULL, NULL, 1, '2021-07-15 17:34:52', '2021-07-15 17:34:52', 2, 43),
(128, 'Verique roscas', 'Limpie la parte interna del cuerpo del Actuador Manual/Automático. Revise que las roscas tanto internas como externas del cuerpo del actuador se encuentran en buen estado, en caso contrario cámbielo por uno nuevo.', 1, NULL, NULL, 1, '2021-07-15 17:34:52', '2021-07-15 17:34:52', 2, 43),
(129, 'Arme el AMA', 'Instale el cuerpo del Actuador Manual/Automático en el soporte y apriételo usando la contra tuerca de la parte inferior. Inserte el pasador.Conecte el PAD al cable conector del PAD proveniente del Módulo CHECKFIRE SC-N. Instale el sello visual de inspección o precinto de seguridad. Conecte la manguera de actuación de 1/4”.', 1, NULL, NULL, 1, '2021-07-15 17:34:52', '2021-07-15 17:34:52', 2, 43),
(130, 'Revise estado de Cable Térmico', 'Revise que el cable térmico se encuentra en buen estado, que no presente desgaste, cortes y/o deformaciones. ', 1, NULL, 1, 1, '2021-07-15 17:34:52', '2021-07-15 17:34:52', 2, 44),
(131, 'Verifique sujeción Cable Térmico', 'Verifique que le Cable Térmico se encuentra debidamente sujetado. Verifique que el cable térmico no presente pérdida o deterioro de la cubierta protectora de color rojo. Verifique que el espaciamiento de los puntos de sujeción sea el adecuado (como máximo cada 30 a 45 cms) y que cuenten con su protector de caucho Rubber y/o abrazaderas con recubrimiento de caucho. ', 1, NULL, NULL, 1, '2021-07-15 17:34:52', '2021-07-15 17:34:52', 2, 44),
(132, 'Distancia de separación Cable Térmico', 'Revise que la distancia de separación entre el cable térmico y cualquier superficie súper caliente (exhostos, turbos, otros) sea como mínimo 30 cm.', 1, NULL, NULL, 1, '2021-07-15 17:34:52', '2021-07-15 17:34:52', 2, 44),
(133, 'Revise Interfaz Triple IR', 'Verifique que la Interfaz Triple IR se encuentra en buen estado, que no presente golpes, grietas y/o deformaciónes. Retire la tapa frontal de la Interfaz Triple IR y verifique que las conexiones internas se encuentran bien ajustadas.', 1, NULL, NULL, 1, '2021-07-15 17:34:52', '2021-07-15 17:34:52', 2, 45),
(134, 'Desconecte y limpie conexiones Triple IR', 'Desconecte todas las conexiones del sistema Triple IR y verifique que no presenten suciedad, humedad y/o corrosión al interior de las conexiones. En caso de presentar suciedad, limpie con limpiador de contactos eléctrico y aplique nuevamente grasa dieléctrica a las conexiones. Si algún componente presenta corrosión, cámbielo por uno nuevo.  ', 1, NULL, NULL, 1, '2021-07-15 17:34:52', '2021-07-15 17:34:52', 2, 45),
(135, 'Limpie detectores Triple IR', 'Limpie el lente de visión de los Detectores Tripe IR con un trapo húmedo. Nota: No utilice agua a alta presión.', 1, NULL, NULL, 1, '2021-07-15 17:34:52', '2021-07-15 17:34:52', 2, 45),
(136, 'Conecte y verifique Triple IR', 'Conecte nuevamente todas las conexiones del sistema Triple IR. Una vez conectados, cada detector realizará automáticamente una prueba BIT interna (30 segundos en LED amarillo). Espere a que todos los detectores se establezcan en modo NORMAL de operación (LED alumbrando color verde). Si algún detector permanece con el LED en amarillo notifique a su Supervisor para evaluar el motivo de la alarma. Realice inmediatamente el correctivo requerido.  ', 1, NULL, NULL, 1, '2021-07-15 17:34:52', '2021-07-15 17:34:52', 2, 45),
(137, 'Realice prueba de funcionamiento al SC-N', '1. Desconecte el PAD. 2. Conecte el Módulo de prueba (P/N ) al cable conector del PAD. 3. Encienda el Módulo de prueba.  4. Posicione el interruptor en la posición “SQUIB”. 5. Resetee el Módulo de prueba y el SC-N. 6. Mediante un destornillador o un alambre de acero genere un puente entre los alambres del Cable Térmico.', 1, NULL, NULL, 1, '2021-07-15 17:34:52', '2021-07-15 17:34:52', 2, 46),
(138, 'Verificar primer tiempo de retardo', 'Verifique durante la prueba el primer tiempo de retardo, este debe ser díez (10) segundos. Anote el tiempo.', 1, NULL, 1, 1, '2021-07-15 17:34:52', '2021-07-15 17:34:52', 2, 46),
(139, 'Verificar segundo tiempo de retardo', 'Verifique durante la prueba el segundo tiempo de retardo, este debe ser díez (10)  segundos. Anote el tiempo.', 1, NULL, 1, 1, '2021-07-15 17:34:52', '2021-07-15 17:34:52', 2, 46),
(140, 'Conecte el PAD', 'Desconecte el Módulo de Prueba y vuelva a conectar el PAD.', 1, NULL, NULL, 1, '2021-07-15 17:34:52', '2021-07-15 17:34:52', 2, 46),
(141, 'RESET del SC-N', 'Presione por cinco (5) segundos el botón RESET del módulo CHECKFIRE SC-N . Verifique que el módulo esté en modo normal de operación (LED verde POWER encendido o pulsando una vez cada tres (3) segundos).', 1, NULL, NULL, 1, '2021-07-15 17:34:52', '2021-07-15 17:34:52', 2, 46),
(142, 'Revise estado de tanques', 'Revise que los cilindros de QS/LVS y sus soportes se encuentren en buen estado, que no presente golpes, corrosión y/o deformación.', 1, NULL, NULL, 1, '2021-07-15 17:34:52', '2021-07-15 17:34:52', 2, 47),
(143, 'Verifique PH de Tanques de QS/LVS', 'Verifique la fecha de fabricación o última prueba hidrostática de los tanques de QS/LVS, esta no debe ser superior a 12 años.', 1, NULL, 1, 1, '2021-07-15 17:34:52', '2021-07-15 17:34:52', 2, 47),
(144, 'Revise indicador de descarga', 'Revise que el indicador de descarga ubicado en la tapa de los tanques LT-A-101-125/250 y LVS-15/30 se encuentre hacia adentro.', 1, NULL, NULL, 1, '2021-07-15 17:34:52', '2021-07-15 17:34:52', 2, 47),
(145, 'Revise estado empaques ', 'Revise que las roscas de las tapas de los tanques y los empaques se encuentren en buen estado. Lubrique los empaques con grasa siliconada.', 1, NULL, NULL, 1, '2021-07-15 17:34:52', '2021-07-15 17:34:52', 2, 47),
(146, 'Revise estado roscas', 'Revise que el estado de las roscas de los tanques y las tapas se encuentren en buen estado, que no presenten desgaste en sus hilos.', 1, NULL, NULL, 1, '2021-07-15 17:34:52', '2021-07-15 17:34:52', 2, 47),
