(149, 'Verifique estado LVS ', 'Verifique que el LVS al interior de cada tanque se encuentre en buen estado (fluido, limpio y de color blancuzco). ', 1, NULL, NULL, 1, '2021-07-15 17:34:52', '2021-07-15 17:34:52', 2, 47),
