(152, 'Retire manguera', 'Desconecte las mangueras de actuación y presurización de 1/4” del Actuador Eléctrico-Neumático.', 1, NULL, NULL, 1, '2021-07-15 17:34:52', '2021-07-15 17:34:52', 2, 55),
