(240, 'Verifique o-rings', 'Retire el o-ring del percutor y de la parte inferior del actuador. Verifique que se encuentra en buen estado, en caso contrario cámbielo por uno nuevo. Limpie y lubrique el o-ring con grasa siliconada. Instale nuevamente el o-ring.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 83),
(241, 'Verifique roscas', 'Limpie la parte interna del cuerpo del actuador.Revise que las roscas tanto internas como externas del cuerpo del actuador se encuentran en buen estado, en caso contrario cámbielo por uno nuevo.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 83),
(242, 'Arme el AEN', 'Instale el cuerpo del Actuador Neumático en el soporte y apriételo usando la contra tuerca. Conecte la manguera de actuación al 1/4”.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 83),
(243, 'Retire manguera', 'Desconecte la manguera de actuación de 1/4” del Actuador Eeléctrico-Neumático.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 84),
(244, 'Remueva AEN', 'Remueva el Actuador Eléctrico-Neumático de su soporte. Retire el resorte y percutor del interior del cuerpo del Actuador.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 84),
(245, 'Verifique o-rings', 'Retire los o-rings del percutor y de la parte inferior del Actuador Eléctrico-Neumático. Verifique que se encuentran en buen estado, en caso contrario cámbielos por uno nuevo. Limpie y lubrique los o-rings con grasa siliconada. Instale nuevamente los o-rings.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 84),
(246, 'Verifique roscas', 'Limpie la parte interna del cuerpo del Actuador Eléctrico-Neumático. Revise que las roscas tanto internas como externas del cuerpo del actuador se encuentran en buen estado, en caso contrario cámbielo por uno nuevo.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 84),
(247, 'Arme el AEN', 'Instale el cuerpo del Actuador Eléctrico-Neumático en el soporte y apriételo usando la contra tuerca. Conecte la manguera de actuación de 1/4” al Actuador Eléctrico-Neumático', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 84),
(248, 'Recarga manual de tanques', 'Recargue los tanques descargados con las siguientes medidas de QS/LVS según su referencia: LT-A-101-30 = 25 lb (11.3 kg)     LT-A-101-50 = 45 lb (20.4 kg)     LT-A-101-125 = 112 lb (50.8 kg)     LT-A-101-250 = 225 lb (102.1 kg)  LVS 5 = 5 ga (18,9 lts)                LVS 10 = 10 gal (37,85 lts)          LVS 15 = 15 gal (56,78 lts)              LVS 30 = 30 gal (113,56 lts) ', 1, NULL, 1, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 85),
(249, 'Cambio de disco niple de ruptura', 'Reemplace los discos o niples de ruptura, aplique teflón en su rosca.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 85),
(250, 'Revise estado de tanques', 'Revise que los cilindros de QS/LVS y sus soportes se encuentren en buen estado, que no presente golpes, corrosión y/o deformación.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 87),
(251, 'Verifique PH de tanques de QS/LVS', 'Verifique la fecha de fabricación o última prueba hidrostática de los tanques de QS/LVS, esta no debe ser superior a 12 años.', 1, NULL, 1, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 87),
(252, 'Revise indicador de descarga', 'Revise que el indicador de descarga ubicado en la tapa de los tanques LT-A-101-125/250 y LVS-15/30 se encuentre hacia adentro.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 87),
(253, 'Revise estado empaques ', 'Revise que las roscas de las tapas de los tanques y los empaques se encuentren en buen estado. Lubrique los empaques con grasa siliconada.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 87),
(254, 'Revise estado roscas', 'Revise que el estado de las roscas de los tanques y las tapas se encuentren en buen estado, que no presenten desgaste en sus hilos.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 87),
(255, 'Verifique estado QS ', 'Verifique que el QS al interior de cada tanque se encuentre en buen estado (fluido y sin presencia de grumos), a través de la tapa y del disco de ruptura.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 87),
(256, 'Verifique altura QS', 'Verifique que la altura entre el QS y la parte superior de la rosca del tanque no exceda el límite. LT-A-101-30: 7-1/2” =19 cms     LT-A-101-50: 8-1/2” =21,59 cms     LT-A-101-125: 9-1/2” = 24,13 cms     LT-A-101-250: 19” = 48,26 cms  ', 1, NULL, 1, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 87),
(257, 'Verifique estado LVS ', 'Verifique que el LVS al interior de cada tanque se encuentre en buen estado (fluido, limpio y de color blancuzco). ', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 87),
(258, 'Verifique altura LVS', 'Verifique que la altura entre el LVS y la parte superior de la rosca del tanque no exceda el límite. LVS 5: 5” = 12,7 cms     LVS 10: 3,5” = 8,89 cms     LVS 15: 4” = 10,16 cms     LVS 30: 12” = 30,48 cms    ', 1, NULL, 1, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 87),
(259, 'Verificar estado discos/niples de ruptura', 'Verifique que los discos de ruptura o niples de ruptura se encuentre en buen estado. Revise la unión universal.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 87),
(260, 'Retire manguera y pasador', 'Desconecte la manguera de actuación de 1/4” del Actuador Manual/Automático. Retire el pasador de seguridad.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 96),
(261, 'Retire PAD activado', 'Retire la guarda protectora del PAD y desconéctelo. Desenrosque la parte superior del actuador retire cuidosamente el PAD activado. Reemplácelo por uno nuevo. ', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 96),
(262, 'Instale nuevo PAD', 'Verifique la fecha de fabricación del nuevo PAD, reemplace si es mayor a 5 años. ', 1, NULL, 1, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 96),
(263, 'Desarme el AMA', 'Remueva el Actuador Manual/Automático de su soporte. Retire el resorte y percutor del interior del cuerpo del Actuador.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 96),
(264, 'Verifique o-rings', 'Retire los o-rings de la rosca superior del actuador, del vástago, y de la parte inferior del Actuador Manual/Automático. Verifique que se encuentran en buen estado, en caso contrario cámbielo por uno nuevo. Limpie y lubrique los o-rings con grasa siliconada. Instalelos nuevamente.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 96),
(265, 'Verique roscas', 'Limpie la parte interna del cuerpo del Actuador Manual/Automático. Revise que las roscas tanto internas como externas del cuerpo del actuador se encuentran en buen estado, en caso contrario cámbielo por uno nuevo.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 96),
(266, 'Arme el AMA', 'Instale el cuerpo del Actuador Manual/Automático en el soporte y apriételo usando la contra tuerca de la parte inferior. Inserte el pasador.Conecte el PAD al cable conector del PAD proveniente del Módulo CHECKFIRE SC-N. Instale el sello visual de inspección o precinto de seguridad. Conecte la manguera de actuación de 1/4”.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 96),
(267, 'Cambie la Batería', 'Desconecte la Batería al interior del Módulo CHECKFIRE SC-N y cambie la batería por una nueva. ', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 97),
(268, 'Instale Nueva Batería', 'Instale la nueva Batería y colóquele su fecha de instalación.', 1, NULL, 1, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 97),
(269, 'Retire Cable Térmico quemado', 'Retire el cable térmico quemado o deteriorado.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 98),
(270, 'Instalte nuevo Cable Térmico', 'Instale nuevo Cable Térmico.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 98),
(271, 'Revise estado de Cable Térmico', 'Revise que el cable térmico se encuentra en buen estado, que no presente desgaste, cortes y/o deformaciones. ', 1, NULL, 1, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 98),
(272, 'Verifique sujeción Cable Térmico', 'Verifique que le Cable Térmico se encuentra debidamente sujetado. Verifique que el cable térmico no presente pérdida o deterioro de la cubierta protectora de color rojo. Verifique que el espaciamiento de los puntos de sujeción sea el adecuado (como máximo cada 30 a 45 cms) y que cuenten con su protector de caucho Rubber y/o abrazaderas con recubrimiento de caucho.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 98),
(273, 'Distancia de separación Cable Térmico', 'Revise que la distancia de separación entre el cable térmico y cualquier superficie súper caliente (exhostos, turbos, otros) sea como mínimo 30 cm.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 98),
(274, 'Revise Interfaz Triple IR', 'Verifique que la Interfaz Triple IR se encuentra en buen estado, que no presente golpes, grietas y/o deformaciónes. Retire la tapa frontal de la Interfaz Triple IR y verifique que las conexiones internas se encuentran bien ajustadas.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 102),
(275, 'Desconecte y limpie conexiones Triple IR', 'Desconecte todas las conexiones del sistema Triple IR y verifique que no presenten suciedad, humedad y/o corrosión al interior de las conexiones. En caso de presentar suciedad, limpie con limpiador de contactos eléctrico y aplique nuevamente grasa dieléctrica a las conexiones. Si algún componente presenta corrosión, cámbielo por uno nuevo.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 102),
(276, 'Limpie detectores Triple IR', 'Limpie el lente de visión de los Detectores Tripe IR con un trapo húmedo.  Nota: No utilice agua a alta presión.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 102),
(277, 'Conecte y verifique Triple IR', 'Conecte nuevamente todas las conexiones del sistema Triple IR. Una vez conectados, cada detector realizará automáticamente una prueba BIT interna (30 segundos en LED amarillo). Espere a que todos los detectores se establezcan en modo NORMAL de operación (LED alumbrando color verde). Si algún detector permanece con el LED en amarillo notifique a su Supervisor para evaluar el motivo de la alarma. Realice inmediatamente el correctivo requerido.  ', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 102),
(278, 'Verifique estado SC-N', 'Verifique que el Módulo CHECKFIRE SC-N se encuentra en buene estado, que no presente golpes, grietas y/o deformaciónes. Anote el serial.', 1, NULL, 1, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 103),
(279, 'Verifique conexiones internas SC-N', 'Retire la tapa frontal del módulo CHECKFIRE SC-N y verifique que las conexiones internas se encuentran bien ajustadas.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 103),
(280, 'Realice prueba de funcionamiento al SC-N', '1. Desconecte el PAD. 2. Conecte el Módulo de prueba (P/N ) al cable conector del PAD. 3. Encienda el Módulo de prueba.  4. Posicione el interruptor en la posición “SQUIB”. 5. Resetee el Módulo de prueba y el SC-N. 6. Mediante un destornillador o un alambre de acero genere un puente entre los alambres del Cable Térmico.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 104),
(281, 'Verificar primer tiempo de retardo', 'Verifique durante la prueba el primer tiempo de retardo, este debe ser díez (10) segundos. Anote el tiempo.', 1, NULL, 1, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 104),
(282, 'Verificar segundo tiempo de retardo', 'Verifique durante la prueba el segundo tiempo de retardo, este debe ser díez (10)  segundos. Anote el tiempo.', 1, NULL, 1, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 104),
(283, 'Conecte el PAD', 'Desconecte el Módulo de Prueba y vuelva a conectar el PAD.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 104),
(284, 'RESET del SC-N', 'Presione por cinco (5) segundos el botón RESET del módulo CHECKFIRE SC-N . Verifique que el módulo esté en modo normal de operación (LED verde POWER encendido o pulsando una vez cada tres (3) segundos).', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 104),
(285, 'Retire manguera', 'Desconecte la manguera de actuación de 1/4” del Actuador Manual Remoto. Retire el pasador de seguridad.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 105),
(286, 'Remueva AMR', 'Remueva el Actuador Manual Remoto de su soporte. Retire el resorte y percutor del interior del cuerpo del Actuador Manual Remoto.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 105),
(287, 'Verifique o-rings', 'Retire los o-rings del percutor y de la parte inferior del Actuador Manual Remoto. Verifique que se encuentran en buen estado, en caso contrario cámbielos por uno nuevo. Limpie y lubrique los o-rings con grasa siliconada. Instale nuevamente los o-rings.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 105),
(288, 'Verifique roscas', 'Limpie la parte interna del cuerpo del Actuador Manual Remoto. Revise que las roscas tanto internas como externas del cuerpo del actuador se encuentran en buen estado, en caso contrario cámbielo por uno nuevo.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 105),
