(290, 'Instale una cápsula en el actuador Booster ', 'Instale una cápsula de barrido LT-A-101-30 nueva/recargada en el actuador Booster para la ejecución de la prueba de actuación.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 108),
