(296, 'Verifique funcionamiento correcto de los cheques', 'Verifique el correcto funcionamiento de los cheques. Esto se cumple cuando ocurre lo siguiente: - Los percutores se mantengan hacia abajo. - Se haya activado la válvula de alivio. - No se evidencien alivios de presión por algunas de las líneas de actuación. ', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 108),
