(313, 'Retire cápsula Booster descargada', 'Retire la cápsula de Barrido LT-A-101-30 de prueba del Booster descargada.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 109),
(314, 'Revise estado de cápsulas de barrido ', 'Revise que la cápsula de barrido se encuentre en buen estado, esta no debe presentar golpes, corrosión y/o deformaciones.', 1, NULL, 1, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 111),
(315, 'Verifique PH de Cápsulas de Barrido', 'Verifique la fecha de fabricación o última prueba hidrostática de las cápsulas de barrido y anótela.  - Para Cápsula de Barrido LT-A-101-30: 12 años. - Para Cápsula de Barrido 55Cu Ft/ 23 Cu Ft: 5 años. En caso que tenga una estrella son 10 años. ', 1, NULL, 1, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 111),
(316, 'Verifique peso cápsulas de barrido', 'Verifique el peso de las cápsulas de barrido  LT-A-101-30 sin tapa, que no exceda ± 14 gr del peso estampado de la cápsula. Anote el peso real en las casillas.', 1, NULL, 1, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 111),
(317, 'Verifique presión cápsulas de barrido', 'Verifique que la presión que se visualiza en el manómetro de las cápsulas estén dentro del rango 1800 - 2300 psi. Anote la presión en las casillas.', 1, NULL, 1, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 111),
(318, 'Cambie Cápsula del Booster', 'Cambie la cápsula del Booster descargada por una cápsula nueva/recargada.', 1, NULL, 1, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 112),
(319, 'Revise estado de cápsula Booster', 'Revise que la cápsula de barrido se encuentre en buen estado, esta no debe presentar golpes, corrosión y/o deformaciones.', 1, NULL, 1, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 112),
(320, 'Verifique PH de cápsula Booster', 'Verifique la fecha de fabricación o última prueba hidrostática de la cápsula de barrido, esta no debe ser superior a 12 años.', 1, NULL, 1, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 112),
(321, 'Verifique peso cápsula Booster', 'Verifique el peso de la cápsula del Booster sin tapa, que no exceda ± 14 gr del peso estampado de la cápsula. Anote el peso real en la casilla.', 1, NULL, 1, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 112),
(322, 'Cambie Cápsula de Actuación AMA', 'En caso de descarga automática, cambie la Cápsula de Actuación LT-10-R descargada del Actuador Manual/Automático por una cápsula nueva/recargada.', 1, NULL, 1, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 113),
(323, 'Cambie Cápsulas de Actuación AMR', 'En caso de descarga manual, cambie la Cápsula de Actuación LT-10-R descargada del Actuador Manual Remoto por una cápsula nueva/recargada.', 1, NULL, 1, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 113),
(324, 'Revise estado de cápsulas de actuación', 'Revise que las cápsulas de actuación se encuentre en buen estado, que no presentan golpes, corrosión y/o deformaciones.', 1, NULL, 1, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 113),
(325, 'Verifique peso cápsulas de actuación', 'Verifique el peso de las cápsulas de actuación LT-10-R sin tapa, del AMA y de los AMR, que no excedan ± 7 gr del peso estampado de las cápsulas. Anote el peso real en las casillas.', 1, NULL, 1, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 113),
(326, 'Verifique percutores AMR´s', 'Verifique que los percutores de los actuadores remotos se encuentren completamente hacia adentro. ', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 118),
(327, 'Instale pasador y sello visual', 'Instale correctamente los pasadores de seguridad y sellos visuales de inspección.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 118),
(328, 'Verifique percutor AMA', 'Verifique que el percutor del actuador manual/automático se encuentre completamente hacia adentro. ', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 120),
(329, 'Instale pasador y sello visual', 'Instale correctamente el pasador de seguridad y sello visual de inspección.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 120),
(330, 'Estado general', 'Revise que los extintores se encuentren en buen estado, que no presente golpes, corrosión y/o deformación.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 123),
(331, 'No Consecutivo', 'Anote el número de consecutivo de los extintores', 1, NULL, 1, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 123),
(332, 'Fecha de Mantenimiento', 'Verifique la fecha del último Mantenimiento de los extintores en su collar de verificación, si se encuentra vencido reemplácelo por uno nuevo o recargado.', 1, NULL, 1, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 123),
(333, 'Sello visual o precinto', 'Verifique que el sello visual de inspección o precinto se encuentra en buen estado.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 123),
(334, 'Indicador de descarga', 'Revise que el indicador de descarga (testigo) ubicado en la tapa del extintor se encuentre hacia adentro.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 123),
(335, 'Agite el extintor', 'Agite los extintores para verificar que esté lleno y la cápsula en su lugar.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 123),
(336, 'Revise manguera', 'Revise que las mangueras de descarga y sus acoples se encuentren en buen estado, que no presenten deterioro, deformación y/o desgaste. Verifique que las conexiones se encuentran apretadas y no tengan golpes, deformación y/o corrosión.   ', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 123),
(337, 'Revise boquilla', 'Verifique que la boquilla no esté tapada y no presente obstrucción.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 123),
(338, 'Revise soporte del extintor', 'Revise que el soporte del extintor se encuentren en buen estado, que no presente golpes, corrosión y/o deformación. ', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 3, 123),
(339, 'Remueva cápsula AMA', 'Remueva la cápsula LT-10-R del Actuador Manual/Automático de la cabina, colóquele su tapa de seguridad y ubíquela en un lugar seguro.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 4, NULL),
(340, 'Retire cápsulas de barrido', 'Retire las cápsulas de barrido LT-A-101-30, 23 CU.FT. y 55 CU.FT. y colóquele su tapa de seguridad y ubíquelas en un lugar seguro.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 4, NULL),
(341, 'Remueva cápsula del Booster ', 'Remueva la cápsula de nitrógeno LT-A-101-30 del Booster y colóquele su tapa de seguridad y ubíquela en un lugar seguro.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 4, NULL),
(342, 'RESET del SC-N', 'Presione por cinco (5) segundos el botón RESET del módulo CHECKFIRE SC-N . Verifique que el módulo esté en modo normal de operación (LED verde POWER encendido o pulsando una vez cada tres (3) segundos)', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 4, NULL),
(343, 'Verifique Módulo SC-N', 'tiene hijo', 1, 1, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 4, NULL),
(344, 'Verifique estado SC-N', 'Verifique que el Módulo CHECKFIRE SC-N se encuentra en buen estado, que no presente golpes, grietas y/o deformaciónes. Anote el serial.', 1, NULL, 1, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 4, 343),
(345, 'Verifique conexiones internas SC-N', 'Retire la tapa frontal del módulo CHECKFIRE SC-N y verifique que las conexiones internas se encuentran bien ajustadas.                           ', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 4, 343),
(346, 'Verifique la batería', 'Verifique la fecha de instalación de la batería. Reemplace si es mayor a un (1) año o no está marcada.', 1, NULL, 1, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 4, NULL),
(347, 'Prueba DELAY al CF SC-N', 'Instale nuevamente la tapa frontal del Módulo CHECKFIRE SC-N. Genere una falla al Módulo CHECKFIRE SC-N y presione por cinco (5) segundos el botón DELAY. Verique que no se enciende ningún led de falla adcional a la falla generada en el Módulo. En caso de encenderse un led de falla adicional, se debe corregir la falla y luego volver a repetir. ', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 4, NULL),
(348, 'Verifique Fin de Línea', 'Verifique que el Fin de Línea se encuentre en buen estado, que no presente deformación o deterioro físico. Con un multímetro verifique la resistencia de la misma (4,7 K ohmios).', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 4, NULL),
(349, 'Verifique Alarmas audiovisuales', 'Revise que las alarmas audiovisuales se encuentren en buen estado, que no presente golpes, grietas y/o deformaciónes.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 4, NULL),
(350, 'Mantenimiento al AMA', 'tiene hijo', 1, 1, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 4, NULL),
(351, 'Retire manguera y pasador', 'Desconecte la manguera de actuación de 1/4” del Actuador Manual/Automático. Retire el pasador de seguridad.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 4, 350),
(352, 'Verifique el PAD', 'Retire la guarda protectora del PAD y desconéctelo. Desenrosque la parte superior del actuador retire cuidosamente el PAD. Verifique la fecha de fabricación del PAD, reemplace si es mayor a 5 años. ', 1, NULL, 1, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 4, 350),
(353, 'Desarme el AMA', 'Remueva el Actuador Manual/Automático de su soporte. Retire el resorte y percutor del interior del cuerpo del Actuador.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 4, 350),
(354, 'Verifique o-rings', 'Retire los o-rings de la rosca superior del actuador, del vástago, y de la parte inferior del Actuador Manual/Automático. Verifique que se encuentran en buen estado, en caso contrario cámbielo por uno nuevo. Limpie y lubrique los o-rings con grasa siliconada. Instalelos nuevamente.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 4, 350),
(355, 'Verique roscas', 'Limpie la parte interna del cuerpo del Actuador Manual/Automático. Revise que las roscas tanto internas como externas del cuerpo del actuador se encuentran en buen estado, en caso contrario cámbielo por uno nuevo.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 4, 350),
(356, 'Arme el AMA', 'Instale el cuerpo del Actuador Manual/Automático en el soporte y apriételo usando la contra tuerca de la parte inferior. Inserte el pasador.Conecte el PAD al cable conector del PAD proveniente del Módulo CHECKFIRE SC-N. Instale el sello visual de inspección o precinto de seguridad. Conecte la manguera de actuación de 1/4”.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 4, 350),
(357, 'Revise Cable Térmico', 'tiene hijo', 1, 1, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 4, NULL),
(358, 'Revise estado de Cable Térmico', 'Revise que el cable térmico se encuentra en buen estado, que no presente desgaste, cortes y/o deformaciones. ', 1, NULL, 1, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 4, 357),
(359, 'Verifique sujeción Cable Térmico', 'Verifique que le Cable Térmico se encuentra debidamente sujetado. Verifique que el cable térmico no presente pérdida o deterioro de la cubierta protectora de color rojo. Verifique que el espaciamiento de los puntos de sujeción sea el adecuado (como máximo cada 30 a 45 cms) y que cuenten con su protector de caucho Rubber y/o abrazaderas con recubrimiento de caucho.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 4, 357),
(360, 'Distancia de separación Cable Térmico', 'Revise que la distancia de separación entre el cable térmico y cualquier superficie súper caliente (exhostos, turbos, otros) sea como mínimo 30 cm.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 4, 357),
(361, 'Mtto sistema Triple IR ', 'tiene hijo', 1, 1, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 4, NULL),
(362, 'Revise Interfaz Triple IR', 'Verifique que la Interfaz Triple IR se encuentra en buen estado, que no presente golpes, grietas y/o deformaciónes. Retire la tapa frontal de la Interfaz Triple IR y verifique que las conexiones internas se encuentran bien ajustadas.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 4, 361),
(363, 'Desconecte y limpie conexiones Triple IR', 'Desconecte todas las conexiones del sistema Triple IR y verifique que no presenten suciedad, humedad y/o corrosión al interior de las conexiones. En caso de presentar suciedad, limpie con limpiador de contactos eléctrico y aplique nuevamente grasa dieléctrica a las conexiones. Si algún componente presenta corrosión, cámbielo por uno nuevo.  ', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 4, 361),
(364, 'Limpie detectores Triple IR', 'Limpie el lente de visión de los Detectores Tripe IR con un trapo húmedo. Nota: No utilice agua a alta presión.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 4, 361),
(365, 'Conecte y verifique Triple IR', 'Conecte nuevamente todas las conexiones del sistema Triple IR. Una vez conectados, cada detector realizará automáticamente una prueba BIT interna (30 segundos en LED amarillo). Espere a que todos los detectores se establezcan en modo NORMAL de operación (LED alumbrando color verde). Si algún detector permanece con el LED en amarillo notifique a su Supervisor para evaluar el motivo de la alarma. Realice inmediatamente el correctivo requerido.  ', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 4, 361),
(366, 'Prueba funcionamiento SC-N', 'tiene hijo', 1, 1, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 4, NULL),
(367, 'Realice prueba de funcionamiento al SC-N', '1. Desconecte el PAD. 2. Conecte el Módulo de prueba (P/N ) al cable conector del PAD. 3. Encienda el Módulo de prueba.  4. Posicione el interruptor en la posición “SQUIB”. 5. Resetee el Módulo de prueba y el SC-N. 6. Mediante un destornillador o un alambre de acero genere un puente entre los alambres del Cable Térmico.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 4, 366),
(368, 'Verificar primer tiempo de retardo', 'Verifique durante la prueba el primer tiempo de retardo, este debe ser díez (10) segundos. Anote el tiempo.', 1, NULL, 1, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 4, 366),
(369, 'Verificar segundo tiempo de retardo', 'Verifique durante la prueba el segundo tiempo de retardo, este debe ser díez (10)  segundos. Anote el tiempo.', 1, NULL, 1, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 4, 366),
(370, 'Conecte el PAD', 'Desconecte el Módulo de Prueba y vuelva a conectar el PAD.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 4, 366),
(371, 'RESET del SC-N', 'Presione por cinco (5) segundos el botón RESET del módulo CHECKFIRE SC-N . Verifique que el módulo esté en modo normal de operación (LED verde POWER encendido o pulsando una vez cada tres (3) segundos).', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 4, 366),
(372, 'Mantenimiento de Tanques', 'tiene hijo', 1, 1, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 4, NULL),
(373, 'Revise estado de tanques', 'Revise que los cilindros de QS/LVS y sus soportes se encuentren en buen estado, que no presente golpes, corrosión y/o deformación.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 4, 372),
(374, 'Verifique PH de Tanques de QS/LVS', 'Verifique la fecha de fabricación o última prueba hidrostática de los tanques de QS/LVS, esta no debe ser superior a 12 años.', 1, NULL, 1, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 4, 372),
(375, 'Revise indicador de descarga', 'Revise que el indicador de descarga ubicado en la tapa de los tanques LT-A-101-125/250 y LVS-15/30 se encuentre hacia adentro.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 4, 372),
(376, 'Revise estado empaques ', 'Revise que las roscas de las tapas de los tanques y los empaques se encuentren en buen estado. Lubrique los empaques con grasa siliconada.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 4, 372),
(377, 'Revise estado roscas', 'Revise que el estado de las roscas de los tanques y las tapas se encuentren en buen estado, que no presenten desgaste en sus hilos.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 4, 372),
(378, 'Verifique estado QS ', 'Verifique que el QS al interior de cada tanque se encuentre en buen estado (fluido y sin presencia de grumos), a través de la tapa y del disco de ruptura.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 4, 372),
(379, 'Verifique altura QS', 'Verifique que la altura entre el QS y la parte superior de la rosca del tanque no exceda el límite.', 1, NULL, 1, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 4, 372),
(380, 'Verifique estado LVS ', 'Verifique que el LVS al interior de cada tanque se encuentre en buen estado (fluido, limpio y de color blancuzco). ', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 4, 372),
(381, 'Verifique altura LVS', 'Verifique que la altura entre el LVS y la parte superior de la rosca del tanque no exceda el límite.', 1, NULL, 1, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 4, 372),
(382, 'Verificar estado discos/niples de ruptura', 'Verifique que los discos de ruptura o niples de ruptura se encuentre en buen estado. Revise la unión universal.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 4, 372),
(383, 'Mangueras presurización 1/4', 'Revise que las mangueras de presurización de 1/4” y sus acoples se encuentren en buen estado, que no tenga deterioro, deformación y/o desgaste. Verifique las conexiones se encuentran apretadas y no tengan golpes, deformación y/o corrosión.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 4, NULL),
(384, 'Pruebe mangueras pres. 1/4', 'Pruebe las mangueras de presurización de 1/4” mediante soplado o instalándolas en la línea de actuación principal.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 4, NULL),
(385, 'Mangueras actuación 1/4', 'Revise que las mangueras de actuación de 1/4” y sus acoples se encuentren en buen estado, que no tenga deterioro, deformación y/o desgaste. Verifique las conexiones se encuentran apretadas y no tengan golpes, deformación y/o corrosión.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 4, NULL),
(386, 'Mangueras distribución 3/4', 'Revise que las mangueras de distribución de 3/4” y sus acoples se encuentren en buen estado, que no tenga deterioro, deformación y/o desgaste. Verifique las conexiones se encuentran apretadas y no tengan golpes, deformación y/o corrosión.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 4, NULL),
(387, 'Mangueras descarga 1/2', 'Revise que las mangueras de descarga de 1/2 y sus acoples se encuentren en buen estado, que no tenga deterioro, deformación y/o desgaste. Verifique las conexiones se encuentran apretadas y no tengan golpes, deformación y/o corrosión.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 4, NULL),
(388, 'Realice barrido', 'Realice barrido con nitrógeno o aire seco. Verifique que las boquillas no estén tapadas, estén correctamente orientadas y que no existan fugas en la red.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 4, NULL),
(389, 'Instale tapaboquillas ', 'Instale todas las tapaboquillas. Cambie las que se encuentren deterioradas. Boquillas QS: tapaboquillas rojas. Boquillas LVS: tapaboquillas azules.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 4, NULL),
(390, 'Mantenimiento AEN´s', 'tiene hijo', 1, 1, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 4, NULL),
(391, 'Retire manguera', 'Desconecte las mangueras de actuación y presurización de 1/4” del Actuador Eléctrico-Neumático.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 4, 390),
