(576, 'Verifique sujeción', 'Verifique el espaciamiento de los puntos de sujeción de todos los componentes del circuito POWER (máximo cada 30 a 90 cms).', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 7, 2),
