(578, 'Revise componentes', 'Revise que los componentes del circuito RELAY se encuentren en buen estado (radio mínimo de curvatura (2½”)).', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 7, NULL),
(579, 'Revise conexiones', 'Verifique que las conexiones de los cables conectores RELAY estén debidamente apretadas (utilice torquímetro).', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 7, NULL),
