(581, 'Verifique Alarmas audiovisuales', 'Revise que las alarmas audiovisuales se encuentren en buen estado, que no presente golpes, grietas y/o deformaciónes.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 7, NULL),
(582, 'Desconecte Batería', 'Desconecte la Batería al interior de la ICM.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 7, NULL),
(583, 'Verifique PAD´s', '', 1, 1, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 7, NULL),
