(608, 'Mantenimiento de Tanques', '', 1, 1, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 7, NULL),
(609, 'Revise estado de tanques', 'Revise que los cilindros de QS/LVS y sus soportes se encuentren en buen estado, que no presente golpes, corrosión y/o deformación.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 7, NULL),
(610, 'Verifique PH de Tanques de QS/LVS', 'Verifique la fecha de fabricación o última prueba hidrostática de los tanques de QS/LVS, esta no debe ser superior a 12 años.', 1, NULL, 1, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 7, NULL),
(611, 'Revise indicador de descarga', 'Revise que el indicador de descarga ubicado en la tapa de los tanques LT-A-101-125/250 y LVS-15/30 se encuentre hacia adentro.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 7, NULL),
(612, 'Revise estado empaques', 'Revise que las roscas de las tapas de los tanques y los empaques se encuentren en buen estado. Lubrique los empaques con grasa siliconada.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 7, NULL),
(613, 'Revise estado roscas', 'Revise que el estado de las roscas de los tanques y las tapas se encuentren en buen estado, que no presenten desgaste en sus hilos.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 7, NULL),
(614, 'Verifique estado QS', 'Verifique que el QS al interior de cada tanque se encuentre en buen estado (fluido y sin presencia de grumos), a través de la tapa y del disco de ruptura.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 7, NULL),
(615, 'Verifique altura QS', 'Verifique que la altura entre el QS y la parte superior de la rosca del tanque no exceda el límite.', 1, NULL, 1, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 7, NULL),
(616, 'Verifique estado LVS', 'Verifique que el LVS al interior de cada tanque se encuentre en buen estado (fluido, limpio y de color blancuzco). ', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 7, NULL),
(617, 'Verifique altura LVS', 'Verifique que la altura entre el LVS y la parte superior de la rosca del tanque no exceda el límite.', 1, NULL, 1, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 7, NULL),
(618, 'Verificar estado discos/niples de ruptura', 'Verifique que los discos de ruptura o niples de ruptura se encuentre en buen estado. Revise la unión universal.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 7, NULL),
(619, 'Mangueras presurización 1/4', 'Revise que las mangueras de presurización de 1/4” y sus acoples se encuentren en buen estado, que no tenga deterioro, deformación y/o desgaste. Verifique las conexiones se encuentran apretadas y no tengan golpes, deformación y/o corrosión.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 7, NULL),
(620, 'Pruebe mangueras pres. 1/4', 'Pruebe las mangueras de presurización de 1/4” mediante soplado o instalándolas en la línea de actuación principal.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 7, NULL),
(621, 'Mangueras distribución 3/4', 'Revise que las mangueras de distribución de 3/4” y sus acoples se encuentren en buen estado, que no tenga deterioro, deformación y/o desgaste. Verifique las conexiones se encuentran apretadas y no tengan golpes, deformación y/o corrosión.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 7, NULL),
(622, 'Mangueras descarga 1/2', 'Revise que las mangueras de descarga de 1/2 y sus acoples se encuentren en buen estado, que no tenga deterioro, deformación y/o desgaste. Verifique las conexiones se encuentran apretadas y no tengan golpes, deformación y/o corrosión.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 7, NULL);
