(623, 'Realice barrido', 'Realice barrido con nitrógeno o aire seco. Verifique que las boquillas no estén tapadas, estén correctamente orientadas y que no existan fugas en la red.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 7, NULL),
(624, 'Instale tapaboquillas', '', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 7, NULL),
(625, 'Mantenimiento AEN´s', '', 1, 1, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 7, NULL),
(626, 'Retire manguera', 'Desconecte la manguera de presurización de 1/4” del Actuador Eléctrico-Neumático.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 7, NULL),
(627, 'Remueva AEN', 'Remueva el Actuador  Eléctrico-Neumático de su soporte. Retire el resorte y percutor del interior del cuerpo del Actuador.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 7, NULL),
(628, 'Verifique o-rings', 'Retire el o-ring del percutor y de la parte inferior del actuador. Verifique que se encuentra en buen estado, en caso contrario cámbielo por uno nuevo. Limpie y lubrique el o-ring con grasa siliconada. Instale nuevamente el o-ring.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 7, NULL),
(629, 'Verifique roscas', 'Limpie la parte interna del cuerpo del actuador.Revise que las roscas tanto internas como externas del cuerpo del actuador se encuentran en buen estado, en caso contrario cámbielo por uno nuevo.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 7, NULL),
(630, 'Arme el AEN', 'Instale el cuerpo del Actuador Neumático en el soporte y apriételo usando la contra tuerca. Conecte la manguera de actuación al 1/4”.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 7, NULL),
(631, 'Mtto Cápsulas de Barrido', '', 1, 1, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 7, NULL),
(632, 'Revise estado de cápsulas de barrido', 'Revise que la cápsula de barrido se encuentre en buen estado, esta no debe presentar golpes, corrosión y/o deformaciones.', 1, NULL, 1, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 7, NULL),
(633, 'Verifique PH de Cápsulas de Barrido', 'Verifique la fecha de fabricación o última prueba hidrostática de las cápsulas de barrido y anótela.  - Para Cápsula de Barrido LT-A-101-30: 12 años. - Para Cápsula de Barrido 55Cu Ft/ 23 Cu Ft: 5 años. En caso que tenga una estrella son 10 años.', 1, NULL, 1, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 7, NULL),
(634, 'Verifique peso cápsulas de barrido', 'Verifique el peso de las cápsulas de barrido  LT-A-101-30 sin tapa, que no exceda ± 14 gr del peso estampado de la cápsula. Anote el peso real en las casillas.', 1, NULL, 1, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 7, NULL),
(635, 'Verifique presión cápsulas de barrido', 'Verifique que la presión que se visualiza en el manómetro de las cápsulas estén dentro del rango 1800 - 2300 psi. Anote la presión en las casillas.', 1, NULL, 1, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 7, NULL),
(636, 'Desconecte Batería', 'Desconecte Batería 210 en el interior del Módulo ICM.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 7, NULL),
(637, 'Instale PAD´s', 'Instale los PAD en los cables terminales RELEASE. Verifique que todos los PAD tengan instalados su O-Ring.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 7, NULL),
(638, 'Instale Cable Terminal RELEASE', 'Instale los cables terminales RELEASE en los actuadores eléctrico/neumáticos. ', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 7, NULL),
(639, 'Conecte Batería', 'Conecte Batería 210 en el interior del Módulo ICM.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 7, NULL),
(640, 'Verifique percutores AEN´s', 'Verifique que los percutores de todos los Actuador Eléctrico-Neumático se encuentren completamente hacia adentro. ', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 7, NULL),
(641, 'Instale cápsulas de barrido', 'Instale las cápsulas de barrido LT-A-101-30, 23 CU.FT. y 55 CU.FT. en los Actuador Eléctrico-Neumático.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 7, NULL),
(642, 'Verifique EMA', '', 1, 1, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 7, NULL),
(643, 'Verifique pasador', 'Verifique que todos los EMA tengan instalado su pasador de seguridad.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 7, NULL),
(644, 'Instale sello visual EMA', 'Instale el sello visual de inspección o precinto.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 7, NULL),
(645, 'Instale sello visual Display', 'Cierre la guarda protectora del Display e instale sello visual de inspección o precinto.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 7, NULL),
(646, 'RESET del CF210', 'Presione por cinco (5) segundos el botón RESET del Display. Verifique que el Display esté operando normalmente (LED verde POWER encendido si está conectado a energía externa o pulsando una vez cada tres (3) segundos si está conectado sólo con su batería interna).', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 7, NULL),
(647, 'Inspección del Extintor', '', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 7, NULL),
(648, 'Estado general', 'Revise que los extintores se encuentren en buen estado, que no presente golpes, corrosión y/o deformación.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 7, NULL),
(649, 'No Consecutivo', 'Anote el número de consecutivo de los extintores', 1, NULL, 1, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 7, NULL),
(650, 'Fecha de Mantenimiento', 'Verifique la fecha del último Mantenimiento de los extintores en su collar de verificación, si se encuentra vencido reemplácelo por uno nuevo o recargado.', 1, NULL, 1, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 7, NULL),
(651, 'Sello visual o precinto', 'Verifique que el sello visual de inspección o precinto se encuentra en buen estado.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 7, NULL),
(652, 'Indicador de descarga', 'Revise que el indicador de descarga (testigo) ubicado en la tapa del extintor se encuentre hacia adentro.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 7, NULL),
(653, 'Agite el extintor', 'Agite los extintores para verificar que esté lleno y la cápsula en su lugar.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 7, NULL),
(654, 'Revise manguera', 'Revise que las mangueras de descarga y sus acoples se encuentren en buen estado, que no presenten deterioro, deformación y/o desgaste. Verifique que las conexiones se encuentran apretadas y no tengan golpes, deformación y/o corrosión.   ', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 7, NULL),
(655, 'Revise boquilla', 'Verifique que la boquilla no esté tapada y no presente obstrucción.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 7, NULL),
(656, 'Revise soporte del extintor', 'Revise que el soporte del extintor se encuentren en buen estado, que no presente golpes, corrosión y/o deformación. ', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 7, NULL),
