(660, 'Desconecte PAD´s', 'Desconecte todos los PAD´s activados y desechelos. Verifique que se hayan retirado igualmente los o-ring´s. ', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 8, NULL),
(661, 'Retire cápsulas de barrido', 'Retire las cápsulas de barrido LT-A-101-30, 23 CU.FT. y 55 CU.FT. descargadas y colóquele su tapa de seguridad y ubíquelas en un lugar seguro.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 8, NULL),
