(664, 'Verifique EMA´s', 'Revise que los EMA se encuentren en buen estado, con su pasador de seguridad y la conexión apretada. ', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 8, NULL),
