(669, 'Revise conexiones', 'Verifique que las conexiones de los cables térmicos, cables conectores y tees del circuito DETECTION estén debidamente apretadas (utilice torquímetro).', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 8, NULL),
(670, 'Verifique sujeción', 'Verifique el espaciamiento de los puntos de sujeción de todos los componentes del circuito DETECTION (máximo cada 30 a 90 cms).', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 8, NULL),
