(675, 'Mtto sistema Triple IR', '', 1, 1, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 8, NULL),
(676, 'Revise Interfaz Triple IR', 'Verifique que la Interfaz Triple IR se encuentra en buen estado, que no presente golpes, grietas y/o deformaciónes. Retire la tapa frontal de la Interfaz Triple IR y verifique que las conexiones internas se encuentran bien ajustadas.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 8, NULL),
(677, 'Desconecte y limpie conexiones Triple IR', 'Desconecte todas las conexiones del sistema Triple IR y verifique que no presenten suciedad, humedad y/o corrosión al interior de las conexiones. En caso de presentar suciedad, limpie con limpiador de contactos eléctrico y aplique nuevamente grasa dieléctrica a las conexiones. Si algún componente presenta corrosión, cámbielo por uno nuevo. ', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 8, NULL),
(678, 'Limpie detectores Triple IR', 'Limpie el lente de visión de los Detectores Tripe IR con un trapo húmedo. Nota: No utilice agua a alta presión.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 8, NULL),
(679, 'Conecte y verifique Triple IR', 'Conecte nuevamente todas las conexiones del sistema Triple IR. Una vez conectados, cada detector realizará automáticamente una prueba BIT interna (30 segundos en LED amarillo). Espere a que todos los detectores se establezcan en modo NORMAL de operación (LED alumbrando color verde). Si algún detector permanece con el LED en amarillo notifique a su Supervisor para evaluar el motivo de la alarma. Realice inmediatamente el correctivo requerido.', 1, NULL, NULL, 1, '2021-07-15 17:34:53', '2021-07-15 17:34:53', 8, NULL),
