(681, 'Revise componentes', 'Revise que los componentes del circuito RELEASE se encuentren en buen estado (radio mínimo de curvatura (2½”)). ', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 8, NULL),
