(720, 'Prueba de Activación manual en EMA.', ' 1. Active manualmente el sistema a tráves de los EMA´s. 2. Verifique la activación exitosa del sistema. 3. Restaure el EMA halando la perilla:  4. Resetee el Display y verifique que quede en modo NORMAL de operación.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 8, NULL),
(721, 'Recarga Tanques', '', 1, 1, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 8, NULL),
(722, 'Recarga manual de tanques', 'Recargue los tanques descargados con las siguientes medidas de QS/LVS según su referencia: LT-A-101-30 = 25 lb (11.3 kg)     LT-A-101-50 = 45 lb (20.4 kg)     LT-A-101-125 = 112 lb (50.8 kg)     LT-A-101-250 = 225 lb (102.1 kg)  LVS 5 = 5 gal (18,9 lts)                LVS 10 = 10 gal (37,85 lts)          LVS 15 = 15 gal (56,78 lts)              LVS 30 = 30 gal (113,56 lts) ', 1, NULL, 1, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 8, NULL),
(723, 'Cambio de disco niple de ruptura', 'Reemplace los discos o niples de ruptura, aplique teflón en su rosca.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 8, NULL),
(724, 'Cambio de tanques', 'Cambie los tanques descargados e instale tanques nuevos/recargados.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 8, NULL),
(725, 'Mantenimiento Tanques', '', 1, 1, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 8, NULL),
(726, 'Revise estado de tanques', 'Revise que los cilindros de QS/LVS y sus soportes se encuentren en buen estado, que no presente golpes, corrosión y/o deformación.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 8, NULL),
(727, 'Verifique PH de tanques de QS/LVS', 'Verifique la fecha de fabricación o última prueba hidrostática de los tanques de QS/LVS, esta no debe ser superior a 12 años.', 1, NULL, 1, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 8, NULL),
(728, 'Revise indicador de descarga', 'Revise que el indicador de descarga ubicado en la tapa de los tanques LT-A-101-125/250 y LVS-15/30 se encuentre hacia adentro.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 8, NULL),
(729, 'Revise estado empaques', 'Revise que las roscas de las tapas de los tanques y los empaques se encuentren en buen estado. Lubrique los empaques con grasa siliconada.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 8, NULL),
(730, 'Revise estado roscas', 'Revise que el estado de las roscas de los tanques y las tapas se encuentren en buen estado, que no presenten desgaste en sus hilos.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 8, NULL),
(731, 'Verifique estado QS', 'Verifique que el QS al interior de cada tanque se encuentre en buen estado (fluido y sin presencia de grumos), a través de la tapa y del disco de ruptura.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 8, NULL),
(732, 'Verifique altura QS', 'Verifique que la altura entre el QS y la parte superior de la rosca del tanque no exceda el límite. LT-A-101-30: 7-1/2” =19 cms     LT-A-101-50: 8-1/2” =21,59 cms     LT-A-101-125: 9-1/2” = 24,13 cms     LT-A-101-250: 19” = 48,26 cms  ', 1, NULL, 1, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 8, NULL),
(733, 'Verifique estado LVS', 'Verifique que el LVS al interior de cada tanque se encuentre en buen estado (fluido, limpio y de color blancuzco). ', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 8, NULL),
(734, 'Verifique altura LVS', 'Verifique que la altura entre el LVS y la parte superior de la rosca del tanque no exceda el límite. LVS 5: 5” = 12,7 cms     LVS 10: 3,5” = 8,89 cms     LVS 15: 4” = 10,16 cms     LVS 30: 12” = 30,48 cms    ', 1, 1, 1, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 8, NULL),
(735, 'Verificar estado discos/niples de ruptura', 'Verifique que los discos de ruptura o niples de ruptura se encuentre en buen estado. Revise la unión universal.', 1, NULL, 1, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 8, NULL),
(736, 'Mangueras presurización 1/4', 'Revise que las mangueras de presurización de 1/4” y sus acoples se encuentren en buen estado, que no tenga deterioro, deformación y/o desgaste. Verifique las conexiones se encuentran apretadas y no tengan golpes, deformación y/o corrosión.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 8, NULL),
(737, 'Pruebe mangueras pres. 1/4', 'Pruebe las mangueras de presurización de 1/4” mediante soplado o instalándolas en la línea de actuación principal.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 8, NULL),
(738, 'Mangueras distribución 3/4', 'Revise que las mangueras de distribución de 3/4” y sus acoples se encuentren en buen estado, que no tenga deterioro, deformación y/o desgaste. Verifique las conexiones se encuentran apretadas y no tengan golpes, deformación y/o corrosión.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 8, NULL),
(739, 'Mangueras descarga 1/2', 'Revise que las mangueras de descarga de 1/2 y sus acoples se encuentren en buen estado, que no tenga deterioro, deformación y/o desgaste. Verifique las conexiones se encuentran apretadas y no tengan golpes, deformación y/o corrosión.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 8, NULL),
(740, 'Realice barrido', 'Realice barrido con nitrógeno o aire seco. Verifique que las boquillas no estén tapadas, estén correctamente orientadas y que no existan fugas en la red.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 8, NULL),
(741, 'Limpie boquillas', 'Retire las boquillas y revise que se encuentren en buen estado. Límpielas e instálelas nuevamente. Verifique que están correctamente orientadas.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 8, NULL),
(742, 'Instale tapaboquillas', 'Instale todas las tapaboquillas. Cambie las que se encuentren deterioradas. Boquillas QS: tapaboquillas rojas. Boquillas LVS: tapaboquillas azules.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 8, NULL),
(743, 'Mantenimiento AEN´s', '', 1, 1, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 8, NULL),
(744, 'Retire manguera', 'Desconecte la manguera de presurización de 1/4” del Actuador Eléctrico-Neumático.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 8, NULL),
(745, 'Remueva AEN', 'Remueva el Actuador  Eléctrico-Neumático de su soporte. Retire el resorte y percutor del interior del cuerpo del Actuador.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 8, NULL),
(746, 'Verifique o-rings', 'Retire el o-ring del percutor y de la parte inferior del actuador. Verifique que se encuentra en buen estado, en caso contrario cámbielo por uno nuevo. Limpie y lubrique el o-ring con grasa siliconada. Instale nuevamente el o-ring.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 8, NULL),
(747, 'Verifique roscas', 'Limpie la parte interna del cuerpo del actuador.Revise que las roscas tanto internas como externas del cuerpo del actuador se encuentran en buen estado, en caso contrario cámbielo por uno nuevo.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 8, NULL),
(748, 'Arme el AEN', 'Instale el cuerpo del Actuador Neumático en el soporte y apriételo usando la contra tuerca. Conecte la manguera de actuación al 1/4”.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 8, NULL),
(749, 'Cambie Cápsulas de Barrido', 'Cambie las cápsulas descargadas por cápsulas nuevas/recargadas.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 8, NULL),
(750, 'Mtto Cápsulas de Barrido', '', 1, 1, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 8, NULL),
(751, 'Revise estado de cápsulas de barrido', 'Revise que la cápsula de barrido se encuentre en buen estado, esta no debe presentar golpes, corrosión y/o deformaciones.', 1, NULL, 1, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 8, NULL),
(752, 'Verifique PH de Cápsulas de Barrido', 'Verifique la fecha de fabricación o última prueba hidrostática de las cápsulas de barrido y anótela.  - Para Cápsula de Barrido LT-A-101-30: 12 años. - Para Cápsula de Barrido 55Cu Ft/ 23 Cu Ft: 5 años. En caso que tenga una estrella son 10 años.', 1, NULL, 1, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 8, NULL),
(753, 'Verifique peso cápsulas de barrido', 'Verifique el peso de las cápsulas de barrido  LT-A-101-30 sin tapa, que no exceda ± 14 gr del peso estampado de la cápsula. Anote el peso real en las casillas.', 1, NULL, 1, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 8, NULL),
(754, 'Verifique presión cápsulas de barrido', 'Verifique que la presión que se visualiza en el manómetro de las cápsulas estén dentro del rango 1800 - 2300 psi. Anote la presión en las casillas.', 1, NULL, 1, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 8, NULL),
(755, 'Desconecte Batería', 'Desconecte Batería 210 en el interior del Módulo ICM.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 8, NULL),
(756, 'Instale PAD´s', 'Instale los PAD en los cables terminales RELEASE. Verifique que todos los PAD tengan instalados su O-Ring.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 8, NULL),
(757, 'Instale Cable Terminal RELEASE', 'Instale los cables terminales RELEASE en los actuadores eléctrico/neumáticos. ', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 8, NULL),
(758, 'Conecte Batería', 'Conecte Batería 210 en el interior del Módulo ICM.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 8, NULL),
(759, 'Verifique percutores AEN´s', 'Verifique que los percutores de todos los Actuador Eléctrico-Neumático se encuentren completamente hacia adentro. ', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 8, NULL),
(760, 'Instale cápsulas de barrido', 'Instale las cápsulas de barrido LT-A-101-30, 23 CU.FT. y 55 CU.FT. en los Actuador Eléctrico-Neumático.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 8, NULL),
(761, 'Verifique EMA', '', 1, 1, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 8, NULL),
(762, 'Verifique pasador', 'Verifique que todos los EMA tengan instalado su pasador de seguridad.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 8, NULL),
(763, 'Instale sello visual EMA', 'Instale el sello visual de inspección o precinto.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 8, NULL),
(764, 'Instale sello visual Display', 'Cierre la guarda protectora del Display e instale sello visual de inspección o precinto.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 8, NULL),
(765, 'RESET del CF210', 'Presione por cinco (5) segundos el botón RESET del Display. Verifique que el Display esté operando normalmente (LED verde POWER encendido si está conectado a energía externa o pulsando una vez cada tres (3) segundos si está conectado sólo con su batería interna).', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 8, NULL),
(766, 'Inspección del Extintor', '', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 8, NULL),
(767, 'Estado general', 'Revise que los extintores se encuentren en buen estado, que no presente golpes, corrosión y/o deformación.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 8, NULL),
(768, 'No Consecutivo', 'Anote el número de consecutivo de los extintores', 1, NULL, 1, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 8, NULL),
(769, 'Fecha de Mantenimiento', 'Verifique la fecha del último Mantenimiento de los extintores en su collar de verificación, si se encuentra vencido reemplácelo por uno nuevo o recargado.', 1, NULL, 1, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 8, NULL),
(770, 'Sello visual o precinto', 'Verifique que el sello visual de inspección o precinto se encuentra en buen estado.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 8, NULL),
(771, 'Indicador de descarga', 'Revise que el indicador de descarga (testigo) ubicado en la tapa del extintor se encuentre hacia adentro.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 8, NULL),
(772, 'Agite el extintor', 'Agite los extintores para verificar que esté lleno y la cápsula en su lugar.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 8, NULL),
(773, 'Revise manguera', 'Revise que las mangueras de descarga y sus acoples se encuentren en buen estado, que no presenten deterioro, deformación y/o desgaste. Verifique que las conexiones se encuentran apretadas y no tengan golpes, deformación y/o corrosión.   ', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 8, NULL),
(774, 'Revise boquilla', 'Verifique que la boquilla no esté tapada y no presente obstrucción.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 8, NULL),
(775, 'Revise soporte del extintor', 'Revise que el soporte del extintor se encuentren en buen estado, que no presente golpes, corrosión y/o deformación. ', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 8, NULL),
(776, 'Retire cápsulas de barrido', 'Retire las cápsulas de barrido LT-A-101-30, 23 CU.FT. y 55 CU.FT. y colóquele su tapa de seguridad y ubíquelas en un lugar seguro.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(777, 'RESET del CF210', 'Presione por cinco (5) segundos el botón RESET del Display.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(778, 'Verifique Display', '', 1, 1, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(779, 'Verifique operación del Display', 'Verifique que el Display esté operando normalmente (LED verde POWER encendido si está conectado a energía externa o pulsando una vez cada tres (3) segundos si está conectado sólo con su batería interna).', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(780, 'Verifique estado', 'Verifique que el Display y su soporte se encuentran en buen estado y debidamente instalados. ', 1, NULL, 1, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(781, 'Revise cables circuito Display', 'Revise los cables del Cicuito de Display se encuentren en buen estado (radio mínimo de curvatura (2½”)). ', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(782, 'Revise conexiones', 'Verifique que las conexiones de los cables Display estén debidamente apretadas (utilice torquímetro).', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(783, 'Verifique ICM', '', 1, 1, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(784, 'Verifique estado ICM', 'Verifique que la ICM se encuentra en buen estado y debidamente instalada. ', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(785, 'Verifique conexiones ICM', 'Verifique que las conexiones a la ICM estén debidamente apretadas (manualmente). ', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(786, 'Verifique la batería', 'Verifique la fecha de instalación de la batería. Reemplace si es mayor a un (1) año o no está marcada.', 1, NULL, 1, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(787, 'Revise EMA´s', 'Revise que los EMA se encuentren en buen estado, con su pasador de seguridad y la conexión apretada. ', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(788, 'Revise Circuito DETECTION', '', 1, 1, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(789, 'Revise componentes', 'Revise que los componentes del circuito DETECTION se encuentren en buen estado (radio mínimo de curvatura (2½”)). ', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(790, 'Revise conexiones', 'Verifique que las conexiones de los cables térmicos, cables conectores y tees del circuito DETECTION estén debidamente apretadas (utilice torquímetro).', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(791, 'Verifique sujeción', 'Verifique el espaciamiento de los puntos de sujeción de todos los componentes del circuito DETECTION (máximo cada 30 a 90 cms).', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(792, 'Distancia de separación Cable Térmico', 'Revise que la distancia de separación entre el cable térmico y cualquier superficie súper caliente (exhostos, turbos, otros) sea como mínimo 30 cm.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(793, 'Verifique Fin de Línea', '', 1, 1, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(794, 'Verifique Fin de Línea Circuito DETECTION No1', 'Revise que el Fin de Línea del Circuito DETECTION No1 se encuentre en buen estado y la conexión apretada.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(795, 'Verifique Fin de Línea Circuito DETECTION No2', 'Revise que el Fin de Línea del Circuito DETECTION No2 se encuentre en buen estado y la conexión apretada.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(796, 'Mtto sistema Triple IR', '', 1, 1, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(797, 'Revise Interfaz Triple IR', 'Verifique que la Interfaz Triple IR se encuentra en buen estado, que no presente golpes, grietas y/o deformaciónes. Retire la tapa frontal de la Interfaz Triple IR y verifique que las conexiones internas se encuentran bien ajustadas.                           ', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(798, 'Desconecte y limpie conexiones Triple IR', 'Desconecte todas las conexiones del sistema Triple IR y verifique que no presenten suciedad, humedad y/o corrosión al interior de las conexiones. En caso de presentar suciedad, limpie con limpiador de contactos eléctrico y aplique nuevamente grasa dieléctrica a las conexiones. Si algún componente presenta corrosión, cámbielo por uno nuevo.  ', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(799, 'Limpie detectores Triple IR', 'Limpie el lente de visión de los Detectores Tripe IR con un trapo húmedo. Nota: No utilice agua a alta presión.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(800, 'Conecte y verifique Triple IR', 'Conecte nuevamente todas las conexiones del sistema Triple IR. Una vez conectados, cada detector realizará automáticamente una prueba BIT interna (30 segundos en LED amarillo). Espere a que todos los detectores se establezcan en modo NORMAL de operación (LED alumbrando color verde). Si algún detector permanece con el LED en amarillo notifique a su Supervisor para evaluar el motivo de la alarma. Realice inmediatamente el correctivo requerido.  ', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(801, 'Revise Circuito RELEASE', '', 1, 1, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(802, 'Revise componentes', 'Revise que los componentes del circuito RELEASE se encuentren en buen estado (radio mínimo de curvatura (2½”)). ', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(803, 'Revise conexiones', 'Verifique que las conexiones de los cables conectores RELEASE y tees del circuito RELEASE estén debidamente apretadas (utilice torquímetro).', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(804, 'Verifique sujeción', 'Verifique el espaciamiento de los puntos de sujeción de todos los componentes del circuito RELEASE (máximo cada 30 a 90 cms).', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(805, 'Revise Circuito POWER', '', 1, 1, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(806, 'Revise componentes', 'Revise que los componentes del circuito POWER se encuentren en buen estado (radio mínimo de curvatura (2½”)). ', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, 2),
(807, 'Revise conexiones', 'Verifique que las conexiones de los cables conectores POWER estén debidamente apretadas (utilice torquímetro).', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, 2),
