(820, 'Prueba CF210 (con Batería)', '', 1, 1, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(821, 'Conecte equipos de prueba', '1. Conecte un Tester Circuito Release en el último Cable Terminal Release. 2. Conecte un Conector de Prueba Release en el resto de Cables Terminal Release. Nota: Si el sistema cuenta sólo con un Actuador Eléctrico/Neumático, conecte el Tester Circuito Release al Cable Terminal Release. El Conector De Prueba Release no es requerido. 3. Desconecte la resistencia fin de línea ubicada al final del circuito principal de detección e instale el Tester Circuito Detection en la posición de la resistencia fin de línea. Nota: Asegúrese que el tester se encuentre en la posición “NORMAL”. ', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(822, 'Prueba Supervisión circuito DETECTION', 'Nota: Si el sistema CF-210 presenta dos circuitos de detección, las pruebas deberán realizarse para cada circuito.  1. Ponga el Tester Circuito Detection en la posición “FAULT” (falla). 2. Verifique que el LED DETECTION 1 en el Display pulse color AMBER a una frecuencia de 1 vez cada 10 segundos (la alarma sonora debe pulsar con la misma frecuencia). 3. Restablezca el Tester Circuito Detección a la posición “NORMAL”. 4. Verifique que el Display vuelva a su estado normal; LED POWER alumbrando permanentemente de color VERDE.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(823, 'Prueba Supervisión circuito RELEASE', '1. Desconecte el Tester Circuito Release del último Cable Terminal Release. 2. Verifique que el LED RELEASE en el Display pulse  color AMBER a una frecuencia de 1 vez cada 10 segundos (la alarma sonora debe pulsar con la misma frecuencia). 3. Conecte nuevamente el Tester Circuito Release al último Cable Terminal Release. 4. Verifique que el Display vuelva a su estado normal; LED POWER alumbrando permanentemente de color VERDE.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL);
INSERT INTO `activ_lists` (`id`, `name`, `description`, `state`, `father`, `funct`, `type`, `created_at`, `updated_at`, `type_id`, `father_id`) VALUES
(824, 'Prueba Supervisión circuito POWER', '1. Verifique que el LED POWER en el Display pulse color AMBER a una frecuencia de 1 vez cada 3 segundos.  2. Resetee el módulo: Presione y mantenga presionado el botón “DELAY/Reset/Silence” por 3 segundos.   3. Verifique que el LED POWER en el Módulo Display pulse color VERDE a una frecuencia de 1 vez cada 3 segundos.  Nota: Una vez se energice el equipo con energía externa, verifique que el Display vuelva a su estado normal; LED POWER alumbrando permanentemente de color VERDE.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(825, 'Prueba de Aislamiento del sistema.', '1. Ponga el sistema en modo Aislado. Verifique que el LED  ISOLATE en el Display pulse color AMBER a una frecuencia de  2 veces cada 30 segundos.  2. Verifique que el sistema no genere la activación de forma automática, a través de los circuitos DETECTION #1 y DETECTION #2.  3. Verifique que el sistema genere la activación exitosa de forma manual, a través del botón  PUSH To Activate.  4. Verifique que el sistema genere la activación exitosa de forma manual, a través de los EMA´s.  5. Cancele el modo Aislado y verifique que Display quede en modo NORMAL de operación.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(826, 'Prueba de activación automática', 'Nota: Si el sistema CF-210 presenta dos circuitos de detección, las pruebas deberán realizarse para cada circuito.  1. Ponga el Tester Circuito Detection en la posición “ALARM” (Alarma). 2. Verifique TD1 y TD2. 3. Verifique la activación automática exitosa del sistema.  4. Resetee el Display y verifique que quede en modo NORMAL de operación.', 1, NULL, 1, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(827, 'Prueba de Reinicios.', '1. Durante el primer tiempo de retardo (TD1) presione el botón “DELAY/Reset/Silence”. Verifique que el sistema inicie nuevamente el primer tiempo de retardo (TD1). 2. Durante el segundo tiempo de retardo (TD2) presione el botón “DELAY/Reset/Silence”. Verifique que el sistema no reinicie nuevamente el segundo tiempo de retardo (TD2).', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(828, 'Prueba de Activación manual en Display.', '1. Active manualmente el sistema a tráves del Display. 2. Verifique la activación exitosa del sistema. 3. Resetee el Display y verifique que quede en modo NORMAL de operación.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(829, 'Prueba de Activación manual en EMA.', '1. Active manualmente el sistema a tráves de los EMA´s. 2. Verifique la activación exitosa del sistema. 3. Restaure el EMA halando la perilla:  4. Resetee el Display y verifique que quede en modo NORMAL de operación.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(830, 'Prueba CF210 (Energía Externa)', '', 1, 1, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
