(840, 'Mantenimiento de Tanques', '', 1, 1, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(841, 'Revise estado de tanques', 'Revise que los cilindros de QS/LVS y sus soportes se encuentren en buen estado, que no presente golpes, corrosión y/o deformación.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(842, 'Verifique PH de Tanques de QS/LVS', 'Verifique la fecha de fabricación o última prueba hidrostática de los tanques de QS/LVS, esta no debe ser superior a 12 años.', 1, NULL, 1, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(843, 'Revise indicador de descarga', 'Revise que el indicador de descarga ubicado en la tapa de los tanques LT-A-101-125/250 y LVS-15/30 se encuentre hacia adentro.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(844, 'Revise estado empaques', 'Revise que las roscas de las tapas de los tanques y los empaques se encuentren en buen estado. Lubrique los empaques con grasa siliconada.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(845, 'Revise estado roscas', 'Revise que el estado de las roscas de los tanques y las tapas se encuentren en buen estado, que no presenten desgaste en sus hilos.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(846, 'Verifique estado QS', 'Verifique que el QS al interior de cada tanque se encuentre en buen estado (fluido y sin presencia de grumos), a través de la tapa y del disco de ruptura.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(847, 'Verifique altura QS', 'Verifique que la altura entre el QS y la parte superior de la rosca del tanque no exceda el límite.', 1, NULL, 1, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(848, 'Verifique estado LVS', 'Verifique que el LVS al interior de cada tanque se encuentre en buen estado (fluido, limpio y de color blancuzco). ', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(849, 'Verifique altura LVS', 'Verifique que la altura entre el LVS y la parte superior de la rosca del tanque no exceda el límite.', 1, NULL, 1, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(850, 'Verificar estado discos/niples de ruptura', 'Verifique que los discos de ruptura o niples de ruptura se encuentre en buen estado. Revise la unión universal.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(851, 'Mangueras presurización 1/4', 'Revise que las mangueras de presurización de 1/4” y sus acoples se encuentren en buen estado, que no tenga deterioro, deformación y/o desgaste. Verifique las conexiones se encuentran apretadas y no tengan golpes, deformación y/o corrosión.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(852, 'Pruebe mangueras pres. 1/4', 'Pruebe las mangueras de presurización de 1/4” mediante soplado o instalándolas en la línea de actuación principal.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(853, 'Mangueras distribución 3/4', 'Revise que las mangueras de distribución de 3/4” y sus acoples se encuentren en buen estado, que no tenga deterioro, deformación y/o desgaste. Verifique las conexiones se encuentran apretadas y no tengan golpes, deformación y/o corrosión.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(854, 'Mangueras descarga 1/2', 'Revise que las mangueras de descarga de 1/2 y sus acoples se encuentren en buen estado, que no tenga deterioro, deformación y/o desgaste. Verifique las conexiones se encuentran apretadas y no tengan golpes, deformación y/o corrosión.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(855, 'Realice barrido', 'Realice barrido con nitrógeno o aire seco. Verifique que las boquillas no estén tapadas, estén correctamente orientadas y que no existan fugas en la red.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(856, 'Instale tapaboquillas', '', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(857, 'Mantenimiento AEN´s', '', 1, 1, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(858, 'Retire manguera', 'Desconecte la manguera de presurización de 1/4” del Actuador Eléctrico-Neumático.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(859, 'Remueva AEN', 'Remueva el Actuador  Eléctrico-Neumático de su soporte. Retire el resorte y percutor del interior del cuerpo del Actuador.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(860, 'Verifique o-rings', 'Retire el o-ring del percutor y de la parte inferior del actuador. Verifique que se encuentra en buen estado, en caso contrario cámbielo por uno nuevo. Limpie y lubrique el o-ring con grasa siliconada. Instale nuevamente el o-ring.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(861, 'Verifique roscas', 'Limpie la parte interna del cuerpo del actuador.Revise que las roscas tanto internas como externas del cuerpo del actuador se encuentran en buen estado, en caso contrario cámbielo por uno nuevo.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(862, 'Arme el AEN', 'Instale el cuerpo del Actuador Neumático en el soporte y apriételo usando la contra tuerca. Conecte la manguera de actuación al 1/4”.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(863, 'Mtto Cápsulas de Barrido', '', 1, 1, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(864, 'Revise estado de cápsulas de barrido', 'Revise que la cápsula de barrido se encuentre en buen estado, esta no debe presentar golpes, corrosión y/o deformaciones.', 1, NULL, 1, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(865, 'Verifique PH de Cápsulas de Barrido', 'Verifique la fecha de fabricación o última prueba hidrostática de las cápsulas de barrido y anótela.  - Para Cápsula de Barrido LT-A-101-30: 12 años. - Para Cápsula de Barrido 55Cu Ft/ 23 Cu Ft: 5 años. En caso que tenga una estrella son 10 años.', 1, NULL, 1, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(866, 'Verifique peso cápsulas de barrido', 'Verifique el peso de las cápsulas de barrido  LT-A-101-30 sin tapa, que no exceda ± 14 gr del peso estampado de la cápsula. Anote el peso real en las casillas.', 1, NULL, 1, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(867, 'Verifique presión cápsulas de barrido', 'Verifique que la presión que se visualiza en el manómetro de las cápsulas estén dentro del rango 1800 - 2300 psi. Anote la presión en las casillas.', 1, NULL, 1, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(868, 'Desconecte Batería', 'Desconecte Batería 210 en el interior del Módulo ICM.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(869, 'Instale PAD´s', 'Instale los PAD en los cables terminales RELEASE. Verifique que todos los PAD tengan instalados su O-Ring.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(870, 'Instale Cable Terminal RELEASE', 'Instale los cables terminales RELEASE en los actuadores eléctrico/neumáticos. ', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(871, 'Conecte Batería', 'Conecte Batería 210 en el interior del Módulo ICM.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(872, 'Verifique percutores AEN´s', 'Verifique que los percutores de todos los Actuador Eléctrico-Neumático se encuentren completamente hacia adentro. ', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(873, 'Instale cápsulas de barrido', 'Instale las cápsulas de barrido LT-A-101-30, 23 CU.FT. y 55 CU.FT. en los Actuador Eléctrico-Neumático.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(874, 'Verifique EMA', '', 1, 1, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(875, 'Verifique pasador', 'Verifique que todos los EMA tengan instalado su pasador de seguridad.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(876, 'Instale sello visual EMA', 'Instale el sello visual de inspección o precinto.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(877, 'Instale sello visual Display', 'Cierre la guarda protectora del Display e instale sello visual de inspección o precinto.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(878, 'RESET del CF210', 'Presione por cinco (5) segundos el botón RESET del Display. Verifique que el Display esté operando normalmente (LED verde POWER encendido si está conectado a energía externa o pulsando una vez cada tres (3) segundos si está conectado sólo con su batería interna).', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(879, 'Inspección del Extintor', '', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(880, 'Estado general', 'Revise que los extintores se encuentren en buen estado, que no presente golpes, corrosión y/o deformación.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(881, 'No Consecutivo', 'Anote el número de consecutivo de los extintores', 1, NULL, 1, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(882, 'Fecha de Mantenimiento', 'Verifique la fecha del último Mantenimiento de los extintores en su collar de verificación, si se encuentra vencido reemplácelo por uno nuevo o recargado.', 1, NULL, 1, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(883, 'Sello visual o precinto', 'Verifique que el sello visual de inspección o precinto se encuentra en buen estado.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(884, 'Indicador de descarga', 'Revise que el indicador de descarga (testigo) ubicado en la tapa del extintor se encuentre hacia adentro.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(885, 'Agite el extintor', 'Agite los extintores para verificar que esté lleno y la cápsula en su lugar.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(886, 'Revise manguera', 'Revise que las mangueras de descarga y sus acoples se encuentren en buen estado, que no presenten deterioro, deformación y/o desgaste. Verifique que las conexiones se encuentran apretadas y no tengan golpes, deformación y/o corrosión.   ', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(887, 'Revise boquilla', 'Verifique que la boquilla no esté tapada y no presente obstrucción.', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL),
(888, 'Revise soporte del extintor', 'Revise que el soporte del extintor se encuentren en buen estado, que no presente golpes, corrosión y/o deformación. ', 1, NULL, NULL, 1, '2021-07-15 17:34:54', '2021-07-15 17:34:54', 9, NULL);
